import './form.scss';
function Form(props) {
    return (
        <div className="Form">
            <form onSubmit={(e) => {
                e.preventDefault(); // Prevent the default form submission
                // Additional form handling logic here, if needed
            }}>
                <div className="Group">

                    <Input inp={props.inp1} />
                    <Input inp={props.inp2} />
                    <Input inp={props.inp3} />

                </div>
                <div className="ButtonR">
                    <button>Submit</button>
                </div>
            </form>

        </div>
    );
}

export default Form
